				<div class="elementor-widget-container">
			<h2 class="elementor-heading-title elementor-size-default">About Me</h2>		</div>
				</div>
						</div>
			</div>
		</div>
				<div class="elementor-element elementor-element-aa10e21 elementor-column elementor-col-66 elementor-top-column" data-id="aa10e21" data-element_type="column">
			<div class="elementor-column-wrap  elementor-element-populated">
					<div class="elementor-widget-wrap">
				<div class="elementor-element elementor-element-1ca3401 elementor-widget elementor-widget-text-editor" data-id="1ca3401" data-element_type="widget" data-widget_type="text-editor.default">
				<div class="elementor-widget-container">
					<div class="elementor-text-editor elementor-clearfix"><p>Born in Medan Sumatera Utara, Indonesia. I grew up with 2 brothers and 1 sister. Father was the chief of Computer Center in USU, a Univerity in North Sumatera.</p><p>Being around computer since childhood, I grew the fond of tinkering with computer. From messing with dad&rsquo;s PC to finalyly learn Basic language.</p><p>I was forced to take Management Major, by my mother who wanted me to be an economist. So I went for 4 years of study in Atmajaya University majoring in Management Economic.</p><p>Took a Video editor position in Jakarta for 2 years where I start&rsquo; tinkering&rsquo; with&nbsp; video and audio technology also animations. Was completing 2 seasons of Educational programme showed on TVRI.</p><p>Then I went back to open my own Business in the field of Internet cafe. This time I followed my heart and provided services to setup networks for offices and also for other similar business. I started my introdction to <strong>linux</strong> and <strong>proxy</strong> and <strong>mikrotik</strong> here. Sometime I took some personal webpage building project for friends or some college students.</p><p>After the downstream of the kind of business I&rsquo;m in, I decided to take another short college in AMIK MBP to deepened my knowledge in programming. Here I strengthen my foundation for high level languages as well as markup language. Finnised with a project for the church for building their Information system based on Laravel framework.</p><p>Mostly I work like ronin, solo. But finding a team that progressing will only exist in a workplace. So, I joined Indogrosir as A Database administrator, with a team of marketing. Which, in time pushes me to work as programmer, developing their support system to accelerate their job, and mine as well.</p><p>I believe in progress. I believe in sharing. To make a progress is to share what you know. This, will never achieved ALONE!</p></div>
				</div>
